import React, { useState, useEffect } from 'react';
import { useQuery } from 'react-query';
import { Search, Filter, Download, Eye, ArrowRight } from 'lucide-react';
import apiService from '../services/api';
import { TRADITIONAL_SYSTEMS, CODE_TYPES, SYSTEM_COLORS, PAGINATION_DEFAULTS } from '../constants';

const SearchPage = () => {
  const [searchTerm, setSearchTerm] = useState('');
  const [selectedSystem, setSelectedSystem] = useState('');
  const [selectedCodeType, setSelectedCodeType] = useState('');
  const [currentPage, setCurrentPage] = useState(0);
  const [pageSize, setPageSize] = useState(PAGINATION_DEFAULTS.PAGE_SIZE);
  const [searchType, setSearchType] = useState('namaste'); // 'namaste' or 'icd11'

  const { data: namasteResults, isLoading: namasteLoading } = useQuery(
    ['namaste-search', searchTerm, currentPage, pageSize],
    () => apiService.searchNamasteCodes(searchTerm, currentPage, pageSize),
    {
      enabled: !!(searchType === 'namaste' && searchTerm.length > 2),
      keepPreviousData: true,
    }
  );

  const { data: icd11Results, isLoading: icd11Loading } = useQuery(
    ['icd11-search', searchTerm, currentPage, pageSize],
    () => apiService.searchIcd11Codes(searchTerm, currentPage, pageSize),
    {
      enabled: !!(searchType === 'icd11' && searchTerm.length > 2),
      keepPreviousData: true,
    }
  );

  const { data: namasteAutoComplete } = useQuery(
    ['namaste-autocomplete', searchTerm],
    () => apiService.getNamasteAutoComplete(searchTerm, 5),
    {
      enabled: !!(searchType === 'namaste' && searchTerm.length > 1),
    }
  );

  const { data: icd11AutoComplete } = useQuery(
    ['icd11-autocomplete', searchTerm],
    () => apiService.getIcd11AutoComplete(searchTerm, 5),
    {
      enabled: !!(searchType === 'icd11' && searchTerm.length > 1),
    }
  );

  const handleSearch = (e) => {
    e.preventDefault();
    if (searchTerm.length > 2) {
      setCurrentPage(0);
    }
  };

  const handlePageChange = (newPage) => {
    setCurrentPage(newPage);
  };

  const getSystemBadgeColor = (system) => {
    switch (system) {
      case TRADITIONAL_SYSTEMS.AYURVEDA:
        return 'badge-ayurveda';
      case TRADITIONAL_SYSTEMS.SIDDHA:
        return 'badge-siddha';
      case TRADITIONAL_SYSTEMS.UNANI:
        return 'badge-unani';
      default:
        return 'badge-gray-100 text-gray-800';
    }
  };

  const getCodeTypeBadgeColor = (codeType) => {
    switch (codeType) {
      case CODE_TYPES.TM2:
        return 'badge-tm2';
      case CODE_TYPES.BIOMEDICINE:
        return 'badge-biomedicine';
      default:
        return 'badge-gray-100 text-gray-800';
    }
  };

  const CodeCard = ({ code, type }) => (
    <div className="bg-white border border-gray-200 rounded-lg p-4 hover:shadow-md transition-shadow">
      <div className="flex items-start justify-between">
        <div className="flex-1">
          <div className="flex items-center space-x-2 mb-2">
            <h3 className="text-lg font-medium text-gray-900">{code.code}</h3>
            {type === 'namaste' ? (
              <span className={`badge ${getSystemBadgeColor(code.system)}`}>
                {code.system}
              </span>
            ) : (
              <span className={`badge ${getCodeTypeBadgeColor(code.codeType)}`}>
                {code.codeType}
              </span>
            )}
          </div>
          <h4 className="text-md font-medium text-gray-800 mb-2">{code.display || code.title}</h4>
          {code.definition && (
            <p className="text-sm text-gray-600 mb-3 line-clamp-2">{code.definition}</p>
          )}
          <div className="flex items-center space-x-4 text-xs text-gray-500">
            <span>Created: {new Date(code.createdAt).toLocaleDateString()}</span>
            {code.category && <span>Category: {code.category}</span>}
            {code.chapter && <span>Chapter: {code.chapter}</span>}
          </div>
        </div>
        <div className="flex items-center space-x-2 ml-4">
          <button className="p-2 text-gray-400 hover:text-gray-600">
            <Eye className="h-4 w-4" />
          </button>
          <button className="p-2 text-gray-400 hover:text-gray-600">
            <Download className="h-4 w-4" />
          </button>
        </div>
      </div>
    </div>
  );

  const Pagination = ({ totalPages, currentPage, onPageChange }) => {
    const pages = [];
    const maxVisiblePages = 5;
    const startPage = Math.max(0, currentPage - Math.floor(maxVisiblePages / 2));
    const endPage = Math.min(totalPages - 1, startPage + maxVisiblePages - 1);

    for (let i = startPage; i <= endPage; i++) {
      pages.push(i);
    }

    return (
      <div className="flex items-center justify-between border-t border-gray-200 bg-white px-4 py-3 sm:px-6">
        <div className="flex flex-1 justify-between sm:hidden">
          <button
            onClick={() => onPageChange(currentPage - 1)}
            disabled={currentPage === 0}
            className="relative inline-flex items-center rounded-md border border-gray-300 bg-white px-4 py-2 text-sm font-medium text-gray-700 hover:bg-gray-50 disabled:opacity-50"
          >
            Previous
          </button>
          <button
            onClick={() => onPageChange(currentPage + 1)}
            disabled={currentPage >= totalPages - 1}
            className="relative ml-3 inline-flex items-center rounded-md border border-gray-300 bg-white px-4 py-2 text-sm font-medium text-gray-700 hover:bg-gray-50 disabled:opacity-50"
          >
            Next
          </button>
        </div>
        <div className="hidden sm:flex sm:flex-1 sm:items-center sm:justify-between">
          <div>
            <p className="text-sm text-gray-700">
              Page <span className="font-medium">{currentPage + 1}</span> of{' '}
              <span className="font-medium">{totalPages}</span>
            </p>
          </div>
          <div>
            <nav className="isolate inline-flex -space-x-px rounded-md shadow-sm" aria-label="Pagination">
              {pages.map((page) => (
                <button
                  key={page}
                  onClick={() => onPageChange(page)}
                  className={`relative inline-flex items-center px-4 py-2 text-sm font-semibold ${
                    page === currentPage
                      ? 'z-10 bg-primary-600 text-white focus:z-20 focus-visible:outline focus-visible:outline-2 focus-visible:outline-offset-2 focus-visible:outline-primary-600'
                      : 'text-gray-900 ring-1 ring-inset ring-gray-300 hover:bg-gray-50 focus:z-20 focus:outline-offset-0'
                  }`}
                >
                  {page + 1}
                </button>
              ))}
            </nav>
          </div>
        </div>
      </div>
    );
  };

  const currentResults = searchType === 'namaste' ? namasteResults : icd11Results;
  const isLoading = searchType === 'namaste' ? namasteLoading : icd11Loading;

  return (
    <div className="space-y-6">
      {/* Header */}
      <div>
        <h1 className="text-2xl font-bold text-gray-900">Search Terminology</h1>
        <p className="mt-1 text-sm text-gray-500">
          Search NAMASTE and ICD-11 codes with advanced filtering
        </p>
      </div>

      {/* Search Form */}
      <div className="bg-white shadow rounded-lg">
        <div className="px-4 py-5 sm:p-6">
          <form onSubmit={handleSearch} className="space-y-4">
            <div className="flex flex-col sm:flex-row gap-4">
              <div className="flex-1">
                <label htmlFor="search" className="block text-sm font-medium text-gray-700 mb-2">
                  Search Term
                </label>
                <div className="relative">
                  <div className="absolute inset-y-0 left-0 pl-3 flex items-center pointer-events-none">
                    <Search className="h-5 w-5 text-gray-400" />
                  </div>
                  <input
                    type="text"
                    id="search"
                    value={searchTerm}
                    onChange={(e) => setSearchTerm(e.target.value)}
                    className="input pl-10"
                    placeholder="Enter search term..."
                  />
                </div>
              </div>
              <div className="sm:w-48">
                <label htmlFor="searchType" className="block text-sm font-medium text-gray-700 mb-2">
                  Search Type
                </label>
                <select
                  id="searchType"
                  value={searchType}
                  onChange={(e) => setSearchType(e.target.value)}
                  className="input"
                >
                  <option value="namaste">NAMASTE Codes</option>
                  <option value="icd11">ICD-11 Codes</option>
                </select>
              </div>
            </div>

            <div className="flex flex-col sm:flex-row gap-4">
              {searchType === 'namaste' && (
                <div className="sm:w-48">
                  <label htmlFor="system" className="block text-sm font-medium text-gray-700 mb-2">
                    Traditional System
                  </label>
                  <select
                    id="system"
                    value={selectedSystem}
                    onChange={(e) => setSelectedSystem(e.target.value)}
                    className="input"
                  >
                    <option value="">All Systems</option>
                    <option value={TRADITIONAL_SYSTEMS.AYURVEDA}>Ayurveda</option>
                    <option value={TRADITIONAL_SYSTEMS.SIDDHA}>Siddha</option>
                    <option value={TRADITIONAL_SYSTEMS.UNANI}>Unani</option>
                  </select>
                </div>
              )}

              {searchType === 'icd11' && (
                <div className="sm:w-48">
                  <label htmlFor="codeType" className="block text-sm font-medium text-gray-700 mb-2">
                    Code Type
                  </label>
                  <select
                    id="codeType"
                    value={selectedCodeType}
                    onChange={(e) => setSelectedCodeType(e.target.value)}
                    className="input"
                  >
                    <option value="">All Types</option>
                    <option value={CODE_TYPES.TM2}>TM2</option>
                    <option value={CODE_TYPES.BIOMEDICINE}>Biomedicine</option>
                  </select>
                </div>
              )}

              <div className="sm:w-32">
                <label htmlFor="pageSize" className="block text-sm font-medium text-gray-700 mb-2">
                  Page Size
                </label>
                <select
                  id="pageSize"
                  value={pageSize}
                  onChange={(e) => setPageSize(Number(e.target.value))}
                  className="input"
                >
                  <option value="10">10</option>
                  <option value="20">20</option>
                  <option value="50">50</option>
                  <option value="100">100</option>
                </select>
              </div>
            </div>

            <div className="flex justify-end">
              <button type="submit" className="btn-primary">
                <Search className="h-4 w-4 mr-2" />
                Search
              </button>
            </div>
          </form>
        </div>
      </div>

      {/* Results */}
      {searchTerm.length > 2 && (
        <div className="bg-white shadow rounded-lg">
          <div className="px-4 py-5 sm:p-6">
            <div className="flex items-center justify-between mb-4">
              <h3 className="text-lg font-medium text-gray-900">
                Search Results
                {currentResults && (
                  <span className="ml-2 text-sm font-normal text-gray-500">
                    ({currentResults.totalElements} found)
                  </span>
                )}
              </h3>
              {currentResults && currentResults.totalElements > 0 && (
                <button className="btn-secondary">
                  <Download className="h-4 w-4 mr-2" />
                  Export Results
                </button>
              )}
            </div>

            {isLoading ? (
              <div className="flex items-center justify-center py-12">
                <div className="loading-spinner"></div>
                <span className="ml-3 text-gray-600">Searching...</span>
              </div>
            ) : currentResults && currentResults.content.length > 0 ? (
              <>
                <div className="space-y-4 mb-6">
                  {currentResults.content.map((code) => (
                    <CodeCard key={code.id} code={code} type={searchType} />
                  ))}
                </div>
                <Pagination
                  totalPages={currentResults.totalPages}
                  currentPage={currentPage}
                  onPageChange={handlePageChange}
                />
              </>
            ) : (
              <div className="text-center py-12">
                <Search className="mx-auto h-12 w-12 text-gray-400" />
                <h3 className="mt-2 text-sm font-medium text-gray-900">No results found</h3>
                <p className="mt-1 text-sm text-gray-500">
                  Try adjusting your search terms or filters.
                </p>
              </div>
            )}
          </div>
        </div>
      )}
    </div>
  );
};

export { SearchPage };
